export default {
  parseData: () => {
		//console.log(Scaling_Picker.files, Scaling_Picker.files[0].data.split('\n'))
		return WeighBridge_Picker.files[0].data
			.split(/\r?\n/)
			.slice(1)
			.map(item => `(${item.split(',').map(val => `'${val}'`).join(',')})`)
			.filter(item => item !== `('')`)
			.join(',')
			.replaceAll(",('')",'');
	},
	uploadData: () => {
		let data = this.parseData();
		///console.log(data)
		Insert_Raw_WeighBridge.run(async () => {
			showAlert('Successfully added new entries');
			resetWidget('WeighBridge_Picker');
		}, () => {}, {'data': data});
	}
}
